import React from 'react';
import './styles.css';

const styles = {
backgroundColor: 'transparent'
};
function Button(props) {

  return (
    <button
      onMouseEnter={(e) => {
        console.log(e)
      }}
      styles={styles}
      className='button'
    >
      {props.text}
    </button>
  );
}

export default Button;
